INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 401, 102301, 2, 24001, 10046, 24, 0.0, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "アヤネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 402, 102301, 2, 24002, 10046, 24, 2.21, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "アヤネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 403, 102301, 2, 24003, 10046, 24, 0.0, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "アヤネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 701, 192201, 1, 24004, 10046, 24, 1.99, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "アサヒ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 702, 192201, 2, 24005, 10046, 24, 2.21, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "アサヒ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 703, 192201, 1, 24006, 10046, 24, 3.33, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "アサヒ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 801, 192301, 2, 24007, 10046, 24, 0.0, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "部員３");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 802, 192301, 2, 24008, 10046, 24, 2.68, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "部員３");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 803, 192301, 2, 24009, 10046, 24, 0.0, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "部員３");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "やった！", 501, 192501, 1, 24010, 10046, 24, 0.0, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "勝ったよ！", 502, 192501, 1, 24011, 10046, 24, 0.0, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "いい調子！", 503, 192501, 1, 24012, 10046, 24, 0.0, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (6, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 111, 113501, 2, 24013, 10046, 24, 5.33, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 112, 113501, 2, 24014, 10046, 24, 6.85, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113, 113501, 2, 24015, 10046, 24, 3.0, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 611, 192401, 2, 24016, 10046, 24, 6.11, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ダイチ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 612, 192401, 2, 24017, 10046, 24, 6.75, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ダイチ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 613, 192401, 2, 24018, 10046, 24, 0.0, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ダイチ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 211, 113401, 1, 24019, 10046, 24, 4.52, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ハツネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 212, 113401, 1, 24020, 10046, 24, 3.89, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ハツネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 213, 113401, 2, 24021, 10046, 24, 13.49, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ハツネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 311, 106501, 2, 24022, 10046, 24, 3.17, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "カヤ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 312, 106501, 2, 24023, 10046, 24, 4.42, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "カヤ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (6, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 313, 106501, 1, 24024, 10046, 24, 2.89, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "カヤ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (4, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 421, 102301, 3, 24025, 10046, 24, 3.71, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "アヤネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 721, 192201, 1, 24026, 10046, 24, 5.1, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "アサヒ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 821, 192301, 3, 24027, 10046, 24, 4.34, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "部員３");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "いい勝負だったよ\nまたやろうね", 521, 192501, 1, 24028, 10046, 24, 0.0, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 101, 113501, 2, 24029, 10046, 24, 5.62, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 102, 113501, 2, 24030, 10046, 24, 9.58, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 103, 113501, 2, 24031, 10046, 24, 0.0, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (2, 0.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 104, 113501, 1, 24032, 10046, 24, 9.13, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (1, 0.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 105, 113501, 2, 24033, 10046, 24, 8.27, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", "ミサト");
